import {React, useState} from 'react'
import './menue.css'
import { Link } from 'react-router-dom/cjs/react-router-dom';

const Menue = ({setActiveCategory}) => {
  const [about, setAbout] = useState(false);
  const [clothing, setClothing] = useState(false);
  const [others, setOthers] = useState(false);
  const [type, setType] = useState(false);
  const [publication, setPublcation] = useState(false);
  const [objects, setObjects] = useState(false);
  const [branding, setBranding] = useState(false);
  const [animations, setAnimations] = useState(false);

  const setAll = () => {
    setClothingFunc(clothing);
    setOthersFunc(others);
    setTypeFunc(type);
    setAnimationsFunc(animations);
    setBrandingFunc(branding);
    setObjectsFunc(objects);
    setPublcationFunc(publication);
  }

  return (
    <div className="menue-menue">
      <Link to="" className="menue-frame92"></Link>
      <div className="menue-frame84">
        <Link to="/about" onClick={() => {
          setAbout(!about)
          setAnimations(false);
          setBranding(false);
          setClothing(false);
          setType(false);
          setObjects(false);
          setPublcation(false);
          setOthers(false);
          setAll();
          }} className={`menue-frame841 ${about ? "about": ""}`}>
          <span className="menue-text">
            <span>about</span>
          </span>
        </Link>
        <button onClick={() => {
          setClothing(!clothing)
          setAbout(false)
          setAnimations(false);
          setBranding(false);
          setType(false);
          setObjects(false);
          setPublcation(false);
          setOthers(false);
          setAll();
          }} className={`menue-frame85 ${clothing ? "clothing": ""}`}>
          <span className="menue-text02">
            <span>clothing</span>
          </span>
        </button>
        <button onClick={() => {
          setOthers(!others)
          setAbout(false)
          setAnimations(false);
          setBranding(false);
          setType(false);
          setObjects(false);
          setPublcation(false);
          setClothing(false);
          setAll();
          }} className={`menue-frame86 ${others ? "others": ""}`}>
          <span className="menue-text04">
            <span>others</span>
          </span>
        </button>
        <button onClick={() => {
          setType(!type)
          setOthers(false)
          setAbout(false)
          setAnimations(false);
          setBranding(false);
          setObjects(false);
          setPublcation(false);
          setClothing(false);
          setAll();
          }} className={`menue-frame87 ${type ? "type1": ""}`}>
          <span className="menue-text06">
            <span>type</span>
          </span>
        </button>
        <button onClick={() => {
          setPublcation(!publication)
          setType(false)
          setOthers(false)
          setAbout(false)
          setAnimations(false);
          setBranding(false);
          setObjects(false);
          setClothing(false);
          setAll();
          }} className={`menue-frame88 ${publication ? "publication": ""}`}>
          <span className="menue-text08">
            <span>publication</span>
          </span>
        </button>
        <button onClick={() => {
          setObjects(!objects)
          setPublcation(false)
          setType(false)
          setOthers(false)
          setAbout(false)
          setAnimations(false);
          setBranding(false);
          setClothing(false);
          setAll();
          }} className={`menue-frame89 ${objects ? "objects": ""}`}>
          <span className="menue-text10">
            <span>3D objects</span>
          </span>
        </button>
        <button onClick={() => {
          setBranding(!branding)
          setObjects(false)
          setPublcation(false)
          setType(false)
          setOthers(false)
          setAbout(false)
          setAnimations(false);
          setClothing(false);
          setAll();
          }} className={`menue-frame90 ${branding ? "branding": ""}`}>
          <span className="menue-text12">
            <span>branding</span>
          </span>
        </button>
        <button onClick={() => {
          setAnimations(!animations)
          setBranding(false)
          setObjects(false)
          setPublcation(false)
          setType(false)
          setOthers(false)
          setAbout(false)
          setClothing(false);
          setAll();
          }} className={`menue-frame91 ${animations ? "animations": ""}`}>
          <span className="menue-text14">
            <span>animations</span>
          </span>
        </button>
      </div>
    </div>
  )
}

export default Menue
